{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/osmancemyilmaz/top-games-analysis?scriptVersionId=104749304\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"1384fed2","metadata":{"papermill":{"duration":0.011482,"end_time":"2022-09-02T10:28:14.189374","exception":false,"start_time":"2022-09-02T10:28:14.177892","status":"completed"},"tags":[]},"source":["## **Top Games Analysis by Osman Cem Yılmaz**\n","<span style=\"font-size:16px;\">This case study is being performed as part of the Google Data Analytics Professional Certificate program. I chose to follow my own case study path about video games.</span>\n","\n","### **Business Task**\n","\n","<span style=\"font-size:16px;\">The business task for this case study is to analyze video game data on Metacritic to find trends and insights that could be used by video game developers when creating a new video game project.</span>\n","\n","### **Questions**\n","<span style=\"font-size:16px;\">1. What is the trend in the number of games published over time? Which months have the most game publishing?<br></span>\n","<span style=\"font-size:16px;\">2. Which games are favored by critics? Which games are favored by users?<br>\n","<span style=\"font-size:16px;\">3. Which platform has more games? How are the game scores across platforms?<br></span>\n","<span style=\"font-size:16px;\">4. How does making more games affect the distribution of game scores?</span>\n","\n","### **About the Data**\n","I'll be using a dataset scraped from Metacritic. Link of the site is [here](https://www.metacritic.com/browse/games/score/metascore/all/all/filtered?sort=desc&view=condensed&page=0). The [dataset](https://www.kaggle.com/datasets/deepcontractor/top-video-games-19952021-metacritic)(\"Top Video Games 1995-2021 Metacritic\") shared by [Deep Contractor](https://www.kaggle.com/deepcontractor) inspired me. The [code](https://www.kaggle.com/code/victorcvriano/scraping-and-analyzing-rap-scores-from-metacritic/notebook)(\"Scraping and analyzing rap scores from Metacritic\") for the webscraping copied and edited from [Victor Severiano](https://www.kaggle.com/victorcvriano).<br>\n","The data contains a list of video games dating from 1995 until 24.08.2022. Games with fewer than 7 critic reviews are excluded. It also provides the platform of the game, release date, user review rating, and critic review rating. From the list in the link, summaries of the games could be scraped, but for this analysis it was unnecessary."]},{"cell_type":"code","execution_count":1,"id":"b50966f4","metadata":{"_execution_state":"idle","_uuid":"051d70d956493feee0c6d64651c6a088724dca2a","execution":{"iopub.execute_input":"2022-09-02T10:28:14.214509Z","iopub.status.busy":"2022-09-02T10:28:14.211796Z","iopub.status.idle":"2022-09-02T10:28:15.549794Z","shell.execute_reply":"2022-09-02T10:28:15.547811Z"},"papermill":{"duration":1.353785,"end_time":"2022-09-02T10:28:15.553048","exception":false,"start_time":"2022-09-02T10:28:14.199263","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.1 ──\n","\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.6     \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4\n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.7     \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.9\n","\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.2.0     \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.4.0\n","\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.1.2     \u001b[32m✔\u001b[39m \u001b[34mforcats\u001b[39m 0.5.1\n","\n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b