n 2020 and 2021 until September, the downtrend after COVID-19 is still valid. The downtrend is also related to the lack of available next-gen consoles due to the chip shortages. It is expected that the upward trend will return with the passing of the COVID effects and the availability of next-gen consoles.</span>"]},{"cell_type":"code","execution_count":17,"id":"42646e44","metadata":{"execution":{"iopub.execute_input":"2022-09-02T10:28:18.370571Z","iopub.status.busy":"2022-09-02T10:28:18.36902Z","iopub.status.idle":"2022-09-02T10:28:18.399698Z","shell.execute_reply":"2022-09-02T10:28:18.397812Z"},"papermill":{"duration":0.054294,"end_time":"2022-09-02T10:28:18.402163","exception":false,"start_time":"2022-09-02T10:28:18.347869","status":"completed"},"tags":[]},"outputs":[],"source":["#Number of games published for each month\n","games.ym.summary <- games %>%\n","                        group_by(release_year,release_month) %>%\n","                        tally()"]},{"cell_type":"code","execution_count":18,"id":"fec3fcc7","metadata":{"execution":{"iopub.execute_input":"2022-09-02T10:28:18.444235Z","iopub.status.busy":"2022-09-02T10:28:18.442601Z","iopub.status.idle":"2022-09-02T10:28:19.39542Z","shell.execute_reply":"2022-09-02T10:28:19.393558Z"},"papermill":{"duration":0.979969,"end_time":"2022-09-02T10:28:19.401694","exception":false,"start_time":"2022-09-02T10:28:18.421725","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd4AU5fkH8O/MbL/bvd4LvYuKXRRF7IiCFTV2rFEjdn+JUaMxRqOxJBqMUZKo\n0djAAgqogCJRVECR3rnet9z2mXl/f8zdcdztHgd3cLj7/fx19+67M8/tJO7DW55XEkKAiIiI\niH7+5L4OgIiIiIh6BxM7IiIiogTBxI6IiIgoQTCxIyIiIkoQTOyIiIiIEgQTOyIiIqIEwcSO\niIiIKEEwsSMiIiJKEKa+DuBnRlVVn8/XW1dLTU1VFCUcDodCod665p6yWq02m03X9V78u/aU\nLMtOpxOA3+9XVbWvwuDjMBxQjyMSiQSDwb6KgY+jzYHzOIQQXq+3r2LYR48jIyOjty5FxMRu\nj2ma1luXkiRJluXeveaeEkL0eQwAjBh0Xe/DMPg4OsTAx8HH0ebAeRx9+zkcII+DqAuciiUi\nIiJKEEzsiIiIiBIEEzs