6</td></tr>\n","\t<tr><td>Sega     </td><td>  47</td></tr>\n","</tbody>\n","</table>\n"],"text/latex":["A tibble: 5 × 2\n","\\begin{tabular}{ll}\n"," platform\\_grouped & num\\_hits\\\\\n"," <chr> & <int>\\\\\n","\\hline\n","\t Sony      & 1063\\\\\n","\t Nintendo  &  889\\\\\n","\t PC        &  875\\\\\n","\t Microsoft &  636\\\\\n","\t Sega      &   47\\\\\n","\\end{tabular}\n"],"text/markdown":["\n","A tibble: 5 × 2\n","\n","| platform_grouped &lt;chr&gt; | num_hits &lt;int&gt; |\n","|---|---|\n","| Sony      | 1063 |\n","| Nintendo  |  889 |\n","| PC        |  875 |\n","| Microsoft |  636 |\n","| Sega      |   47 |\n","\n"],"text/plain":["  platform_grouped num_hits\n","1 Sony             1063    \n","2 Nintendo          889    \n","3 PC                875    \n","4 Microsoft         636    \n","5 Sega               47    "]},"metadata":{},"output_type":"display_data"}],"source":["#Number of Classic Games for Platforms\n","(platform.classics <- games %>% mutate(score=(metascore+user_score)/2) %>% filter(score >= 90) %>% group_by(platform_grouped) %>% summarise(num_classics=n()) %>% arrange(desc(num_classics)))\n","#Number of Hit Games for Platforms\n","(platform.hits <- games %>% mutate(score=(metascore+user_score)/2) %>% filter(score >= 80 & score < 90) %>% group_by(platform_grouped) %>% summarise(num_hits=n()) %>% arrange(desc(num_hits)))"]},{"cell_type":"markdown","id":"f6838424","metadata":{"papermill":{"duration":0.034033,"end_time":"2022-09-02T10:28:23.575561","exception":false,"start_time":"2022-09-02T10:28:23.541528","status":"completed"},"tags":[]},"source":["<span style=\"font-size:16px;\">Sony has the highest number of games, number of classic games, and number of hit games overall. From the yearly number of games for each platform, it could be seen that Sony has fewer games than Nintendo and PC for the last 5 years(in 2022, Sony will have the same number of games as Nintendo right now). Sony had highly successful years with the PlayStation 1 and the PlayStation 2. Both the PlayStation 1 and the PlayStation 2 have a diverse and expansive library of exclusive games. The exclusive games for Sony consoles are still continuing, but Sony has started releasing exclusive games for PC after a few years when the game was released on the console.<br><br>Nintendo is the second company according to the number of games, classic games, and hit games. Nintendo was always in the lead on handheld consoles until the rise of mobile gaming on cellphones. The company has had a unique long-lasting game series and unique console capabilities for the last 3 generations. The number of games for Nintendo was drastically reduced in the 2010s due to the unsuccessful Wii U platform and a lack of indie games. But with the launch of the Switch, the popularity of Nintendo has increased again. Switch's hybrid capabilities(as a home console and a handheld console) allow it to appeal to a wide customer base, and it receives plenty of support from both first-party and third-party developers.<br><br>The PC is the third platform, trailing consoles at first, and has been the most popular platform for the last two years. In the mid-2000s, through digital distribution on services, the PC platform's popularity started to increase. With the launch of Steam Deck, it is expected the PC platform will continue its popularity.<br><br>Microsoft, which joined the game industry later than other companies, was seen as an alternative to Sony. With the launch of Xbox Game Pass, Microsoft's business model has changed into in-game sales and online service subscriptions. In 2022, Sony also adopted the same strategy with the new PlayStation Plus subscriptions.</span>"]},{"cell_type":"code","execution_count":33,"id":"f6170fcf","metadata":{"execution":{"iopub.execute_input":"2022-09-02T10:28:23.647115Z","iopub.status.busy":"2022-09-02T10:28:23.645536Z","iopub.status.idle":"2022-09-02T10:28:23.761992Z","shell.execute_reply":"2022-09-02T10:28:23.760195Z"},"papermill":{"dur