roup_by(release_year) %>% summarise(num_classics=n()) %>% arrange(release_year)\n","yearly.hits <- games %>% mutate(score=(metascore+user_score)/2) %>% filter(score >= 80 & score < 90) %>% group_by(release_year) %>% summarise(num_hits=n()) %>% arrange(release_year)\n","year.temp <- left_join(yearly.avg, yearly.classics, by=c(\"release_year\" = \"release_year\"))\n","year.corr <- left_join(year.temp, yearly.hits, by=c(\"release_year\" = \"release_year\"))\n","year.corr$release_year <- as.numeric(year.corr$release_year)\n","#There is no classic game in 1995.\n","year.corr[year.corr$release_year == 1995, ]$num_classics <- 0\n","View(year.corr)"]},{"cell_type":"code","execution_count":34,"id":"003b5b85","metadata":{"execution":{"iopub.execute_input":"2022-09-02T10:28:23.837558Z","iopub.status.busy":"2022-09-02T10:28:23.835765Z","iopub.status.idle":"2022-09-02T10:28:24.104539Z","shell.execute_reply":"2022-09-02T10:28:24.101272Z"},"papermill":{"duration":0.307999,"end_time":"2022-09-02T10:28:24.107711","exception":false,"start_time":"2022-09-02T10:28:23.799712","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["corrplot 0.92 loaded\n","\n"]},{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd3xUVbfG8d+Z9AIJkNAh9F6kKkWQKgGVJkWKimB9URELCuhFEQUBRbGjiKAC\nFpCmIipYQRQLICKggHRCAiEhPZn7RwIhGCUzk5kzmfN8P7nc5JyTPYv9SrJmr10Mu92OiIiI\niJR8NrMDEBEREZHiocRORERExEcosRMRERHxEUrsRERERHyEEjsRERERH6HETkRERMRHKLET\nERER8RFK7ERERER8hBI7ERERER+hxE5ERETERyixExEREfERSuxEREREfIQSOxEREREfocRO\nRERExEcosRMRERHxEUrsRERERHyEEjsRERERH6HETkRERMRHKLETERER8RFK7ERERER8hBI7\nERERER+hxE5ERETERyixExEREfERSuxEREREfIQSOxEREREfocRORERExEcosRMRERHxEUrs\nRERERHyEEjsRERERH6HETkRERMRHKLETERER8RFK7ERERER8hBI7ERERER+hxE5ERETERyix\nExEREfERSuxEREREfIQSOxEREREfocROpCSL28bSxfz4B3azIxERES+gxE6kBLHz5G00rc3R\nMwD7F1K9JUOH0aYBV9xFlpI7ERGrU2InUnLM68vEV9iVgM0AuHo8mUFMe4aRLflqLk9vNzs+\nERExmWG3612+SAlRMZzk2hz8gchA0vcRVpue7/NRf7